import React, { useState, useCallback } from 'react';
import fetchItemGroups from '../../apis/itemGroup';

function Home() {
    const [ itemGroups, setItemGroups ] = useState([]);
    useCallback(() => {
        console.log(`callback gets ${fetchItemGroups}`);
        fetchItemGroups().then(setItemGroups);
    },[itemGroups]);

    return (
        <div className='Home'>
            <h1>Welcome to Emil's Quality Honey and Bee Product Specialities!</h1>
            <h5>(Since 2024!)</h5>
            <h3>Every product is organic and intimately fostered by farmer Emil. Have a look:</h3>
            <div className="itemGroupWrapper">
                <p>{itemGroups.id}</p>
                <p>{itemGroups.name}</p>
                <p>{itemGroups.description}</p>
            </div>
        </div>
    );
};

export default Home;
